import styled,{createGlobalStyle} from 'styled-components';


const GlobalStyle = createGlobalStyle`
    *{
        box-sizing:border-box;
    }
    body{
        font-family: 'Muli', sans-serif;
        padding:20px 60px;
        margin:0;
        padding:0;
    }
    a{
        text-decoration:none;
        color:black;
    }
`


export default GlobalStyle;
